import React from 'react';
import { Link } from "react-router-dom";
import  LogoTray  from './LogoTray.js';

// import styled from "styled-components";
// const Logos = styled.div`
//   list-style: none;
//   display: flexbox;  
//   // flex-flow: row wrap;  
//   // justify-content: flex-start;
// `;

const TopNavBar = ()=> {
  return (
    <nav >            
        <ul>                
          <li>            
            <LogoTray />
          </li>                  

          <li className='topnav-button'>
            <Link to='/boricanna'>
              Boricanna
            </Link>          
          </li>              

          <li className='topnav-button'>
            <Link to='/brands'>
              Brands
            </Link>          
          </li>      

          <li className='topnav-button'>
            <Link to='/sustainability'>
              Sustainability
            </Link>          
          </li>

          <li className='topnav-button'>
            <Link to='/company'>
              Company
            </Link>          
          </li>

          <li className='topnav-button'>
            <Link to='/careers'>
              Careers
            </Link>          
          </li>              
        </ul> 

    </nav>
  )
};

export default TopNavBar;
